export function getList() {
    return fetch('http://192.168.220.129:54000/api_v01/camp')
        .then(data => data.json())
}

export function setItem(item: any) {
    return fetch('http://192.168.220.129:54000/api_v01/camp', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify({ item })
    })
        .then(data => data.json())
}
